fn main() {
    assert_eq!(8, Solution::appeal_sum("abb".to_string()));
    assert_eq!(10, Solution::appeal_sum("abc".to_string()));
    assert_eq!(9, Solution::appeal_sum("aba".to_string()));
    assert_eq!(20, Solution::appeal_sum("code".to_string()));
    assert_eq!(87613395866, Solution::appeal_sum("".to_string()));
}

struct Solution;

impl Solution {
    pub fn appeal_sum(s: String) -> i64 {
        let s = s.as_bytes();
        let n = s.len();
        let mut ans = 1;
        let mut prev = 1;
        let mut indices = vec![-1; 26];
        indices[(s[0] - b'a') as usize] = 0;
        for i in 1..n {
            let idx = (s[i] - b'a') as usize;
            prev += i as i64 - indices[idx];
            indices[idx] = i as i64;
            ans += prev;
        }
        ans
    }
}
